import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const CountryDetails = () => {
  return (
    <View style={styles.container}>
      <Text>CountryDetails</Text>
    </View>
  )
}

export default CountryDetails

const styles = StyleSheet.create({
    container:{flex:1}
})
